&quot;Hoodie&quot; is the second single from Omarion's third studio album, Ollusion. The song, which features Jay Rock, has failed to chart.

The video is dedicated to Michael Jackson, and has been described by Omarion himself as &quot;a mix between 'Beat It' and Bad. The single's sequel is set to be 'Speedin' following the events of the 'Hoodie' music video'.&quot;

Ollusion is the third studio album from R&amp;B singer Omarion on EMI.[4] The album was released January 12, 2010. This is also reported to be Omarion first solo album with the Parental Advisory label on it. It sold 21,200 copies its first week.

Omari Ismael Grandberry (born November 12, 1984), better known as Omarion, is an American R&amp;B singer, actor, songwriter, record producer, dancer, and former lead singer of the boy band, B2K. His third album Ollusion was released January 12, 2010 with the lead single &quot;I Get It In.&quot; Omarion is also currently the newest judge of the hit show America's Best Dance Crew on MTV.

It was reported that on the July 20th, Omarion had signed with Lil Wayne's Young Money Label under Cash Money Records. But rumors had began to spread that Omarion was dropped from the label due to leaking the single &quot;I Get It In&quot; featuring Lil Wayne. On August 21, 2009 Omarion Posted on Twitter that he wasn't dropped from Young Money Records for leaking the song, but had asked to be released from Young Money Records to pursue other arrangements with no conflict with the company or its roster. He also added that he has a lot of respect for Lil Wayne, and what he is so notorious for. This was also supported later that week in an interview with Lil Wayne he stated himself that it was just a 'business decision' and Omarion asked for the release to better his career. Since parting ways with Young Money, Omarion created his own imprint StarWorld Entertainment and signed with EMI while redoing the 1st single &quot;I Get It In&quot;, which now features So Icey/Atlantic artist Gucci Mane. &quot;Hoodie&quot; will be the follow-up single with Jay Rock.


